import http from "./http-common";
import authHeader from "./auth-header";

class ReviewService {
  getAll() {
    return http.get("/review");
  }

  getFeatured() {
    return http.get("/review/featured");
  }

  get(id) {
    return http.get(`/review/${id}`);
  }

  create(data) {
    return http.post("/review", data, {
      headers: {
        "x-access-token":
          "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6MTEsImlhdCI6MTY2OTgyNDc5MSwiZXhwIjoxNjY5OTExMTkxfQ.XM4fZl5D9w0cSkO5yhHx70pCbRo0srzBRxYLsT_X2WI",
      },
    });
  }

  update(id, data) {
    return http.put(`/review/${id}`, data);
  }

  delete(id) {
    return http.delete(`/review/${id}`);
  }
}

export default new ReviewService();
